import React from "react";

function Navbar() {
  return (
    <div>
      <div className="flex justify-spa">
        <div>Home</div>
        <div>Product</div>
        <div>Dealer Registration</div>
        <div>Support</div>
        <div>About</div>
      </div>
    </div>
  );
}

export default Navbar;
